import { Reset } from "styled-reset";
import "./App.css";
import { RouterProvider, createBrowserRouter } from "react-router-dom";
import Root from "./page/Root";

const router = createBrowserRouter([
  { path: "/", 
  element: <Root /> }
]);
function App() {
  return (
    <>
      <Reset />
      <RouterProvider router={router}/>
    </>
  );
}

export default App;
